{"1": {"comment_id": "yanyanleeeart"  "comment_text": "Day 25: Splat @inktober

Haha I actually didn’t know what splat means  googled and one of the interpretations is “ in a way that makes the sound of something hitting the surface of a liquid” Sure  then my brain naturally wants to draw a pool diving figure  then somehow added the watermelon 🍉 pool and lotus leaves for fun 🤪 and the dragonflies cause they are cute 🥰 and while drawing this  a childhood fav song came into mind - 菊次郎的夏天 Summer by the master musician @joehisaishi.official hahah lovely tunes - suddenly I m craving for that watermelon kinda summer again 🍉🕶⛱

#inktobersplat #inktobersplat2021 #inktober #yaninktober2021 #inktoberprompts #inktober2021 #watermelon #pool #summer #diving #dragonfly #lotus #leaves #lotusleaf #cartoon #cute #childhood #summer #water #play #fun #splash #splat #drawing #ink #illustration"}  "2": {"comment_id": "yanyanleeeart"  "comment_text": "Send pics 🌌👉@ink._master"}}

