{"1": {"comment_id": "rawinfinland"  "comment_text": "What is your passion?

I love seeking extra quality fruit. When I open a fruit and see it's perfect  you can see me as my happiest! 😆😍

#passionfruit #fruit #fruits #melon #watermelon #orange #mandarine #tangerine #kiwi #apple #nectarine #pineapple #peach #grapes #honeydew #pomelo #pear #mango #papaya #clementine #cherimoya #dragonfruit #mangosteen #plantain #avocado #durian #jackfruit #satsuma #eggfruit #cantaloupe"}  "2": {"comment_id": "rawinfinland"  "comment_text": "Is that a passionfruit? I never see the wrinkly skins anymore. In Thailand mostly yellow or purplish smooth skin. Possibly my favourite fruit along with durian and mangosteen. And those 3 combine divinely. Easily available in South East Asia but rare in India. My garden vine is growing really well. I need to learn how to help it flower 🌼"}  "3": {"comment_id": "fruits_of_asia"  "comment_text": "Love all those hashtags. My faves too"}}

